column6:
Целями фонда являются:
оказание материальной и иной помощи несовершеннолетним детям, детям, оставшимся без попечения родителей, детям сиротам, инвалидам;
оказание материальной и иной помощи домам малюток, детским домам, домам-интернатам, школам-интернатам, специальным учебно-воспитательным центрам, независимо от их национальности и вероисповедания.
